import "./App.css";

import Form from "./Form";
import FormList from "./FormList";
import ListTodo from "./ListTodo";

function App() {
  return (
    <div className="App">
      <Form />
      <FormList />
      <ListTodo />
    </div>
  );
}

export default App;
